import React from "react";
import { useRef } from "react";

function UploadRoom() {
	const ref = useRef([]);
	const uploadData = (e) => {
		e.preventDefault();

		const Roomid = ref[0];
		const description = ref[1];
		const image = ref[2];
		const type = ref[3];
		console.log({
			RoomId: Roomid,
			description: description,
		});
	};
	return (
		<div className="bg-white min-vh-100 m-auto">
			<h1 className="d-flex justify-content-center mb-4">
				Insert Room Details
			</h1>
			<form className="p-4 mx-5">
				<div className="row my-5">
					<label className="form-label col-sm-6">RoomId</label>
					<input type="text" ref={ref[0]} className="form-control col-sm-6" />
				</div>
				<div className="row my-5">
					<label className="form-label col-sm-6">Description</label>
					<input type="text" ref={ref[1]} className="form-control col-sm-6" />
				</div>
				<div className="row my-5">
					<label className="form-label col-sm-6">Images</label>
					<input type="file" ref={ref[2]} className="form-control col-sm-6" />
				</div>
				<div className="row my-5">
					<label className="form-label col-sm-6">Room No</label>
					<input type="text" ref={ref[3]} className="form-control col-sm-6" />
				</div>
				<div className="row d-flex justify-content-center mt-4">
					<button className="btn-lg btn-success" onClick={uploadData}>
						Submit
					</button>
				</div>
			</form>
		</div>
	);
}

export default UploadRoom;
